import React from 'react';
import {styles} from '../component/Styles';
import { Text, View, TouchableOpacity,FlatList } from 'react-native';
import {ListItem,Avatar} from 'react-native-elements';
import db from '../config';
import firebase from 'firebase';
import MyHeaderCity from '../component/MyHeaderCity';
import MyHeaderCity1 from '../component/MyHeaderCity1';

const citylist = [
    {
        name:'Mumbai',
        avatar_url:'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSIVemyw67Tiu13GKRL4dVu5glKJvaQXzbsmA&usqp=CAU'
    },
    {
        name:'Delhi',
        avatar_url:'data:image/jpeg;base64,'
    },
    {
        name:'Chennai',
        avatar_url:'data:image/jpeg;base64,'
    },
    {
        name:'Kolkata',
        avatar_url:'data:image/jpeg;base64,'
    },
    {
        name:'Hyderabad',
        avatar_url:'data:image/jpeg;base64,'
    },
    {
        name:'Bengalaru',
        avatar_url:'data:image/jpeg;base64,'
    }
]

export default class City extends React.Component{

    constructor(){
        super()
        this.state={
            PaymentStatus:''
        }
    }

    keyExtractor = (item, index) => index.toString()

    renderItem = ({ item }) => {
      return(
        <ListItem
        bottomDivider
        onPress={()=>{
          this.props.navigation.navigate('Date')
          db.collection('DatesCities').add({
              "City":item.name
          })
        }}
      >
        <Avatar source={{uri: item.avatar_url}} />
        <ListItem.Content>
        <ListItem.Title>{item.name}</ListItem.Title>
        </ListItem.Content>
        </ListItem>
    )}

    paymentstatus = async() => {
        const citiesRef = db.collection('Cart')
        const snapshot = await citiesRef.get();
        var paymentstatus = ''
        snapshot.docs.map(doc => {
            paymentstatus = doc.data().PaymentStatus
        })
        this.setState({
            PaymentStatus:paymentstatus
        })
    }

    componentDidMount(){
        this.paymentstatus()
    }

    render(){
        {
            if(this.state.PaymentStatus === 'Success'){
                return(
                    <View style={styles.container}>
                        <View style={{marginTop:180,width:370}}>
                            <MyHeaderCity1 title="Your Order" navigation={this.props.navigation} />
                        </View>
                        <FlatList
                        renderItem={this.renderItem}
                        keyExtractor={this.keyExtractor}
                        data={citylist}
                        style={{width:300,marginTop:50}}
                        />
                    </View>
                )
            }else{
                return(
                    <View style={styles.container}>
                        <View style={{width:370}}>
                            <MyHeaderCity title="Select City" navigation={this.props.navigation} />
                        </View>
                        <FlatList
                        renderItem={this.renderItem}
                        keyExtractor={this.keyExtractor}
                        data={citylist}
                        style={{width:300,marginTop:50}}
                        />
                    </View>
                )
            }
        }
    }
}